  [],\n\t\"revision_timestamp\": \"2016-07-27T22:18:21.952610\",\n\t\"name\": \"stillwater-national-wildlife-refuge-and-stillwater-wildlife-management-area-annual-water-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"An estimated 70,000 acre feet (AF) of water
  are needed annually to maintain 14,000 acres of permanent marsh currently administered
  by the Stillwater NWR.  The 1997 water projections forecast a 100% irrigation delivery
  year starting in mid-March ending in mid-November. Based on projected water storage
  and precautionary releases from Lahontan Reservoir, releases and return flows to
  the refuge are estimated to be 53,000-73,000 AF. These flows will be augmented by
  nearly 8,200 AF of acquired prime water deliveries providing an estimated 61,200-81,200
  AF to maintain 12,240-16,240 wetland acres at SNWR.\",\n\t\"license_title\": \"License
